import React, {useState, useEffect} from 'react'
import { getInformationKor } from '../getDataFromSoldOut/getInformationKor'

export const mergeData = async (submitCode) => {
    const [data, setData] = useState([])
    useEffect(
        () => {
            const fetchApi = async () => {
                const data = await getInformationKor(submitCode)
                // const responeData = data.data.data.product_info.list;
                console.log(data);
                setData(data)    
            }
            fetchApi();
        }, [submitCode]
    )
}
